import React from 'react';
import Dictionary from '../assets/JSON/words.json'; // Import the words json file

const Word = () => {

    const getRandomWord = () => {
        let randomWord = Dictionary[Math.floor(Math.random() * Dictionary.length)];
        alert('word: ' + randomWord[0]);
    }

    return (
        <div>
            <button type='button' className='btn btn-light' onClick={getRandomWord}>Get Word</button>
        </div>
    );
};

export default Word;
